import React from 'react';

export default class Header extends React.Component{
    render(){
        return(
            <div style={decor.container}>
                <h1><img src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549900826/BlanchetteProject/header.webp' style={decor.header}/></h1>
                <div style={decor.spans}>
                    <span style={decor.user}>Sign in/Register</span>
                    <span style={decor.fav}><i class="far fa-star"></i></span>
                    <span style={decor.bag}><i class="fas fa-shopping-bag"></i>Bag</span>
                </div>
            </div>
        )
    }
}

const decor = {
    container:{
        height: '200px',
    },
    header:{
       width: '500px',
       height: '150px',
       marginLeft: '35%',
       marginBottom: '0%'


    },
    spans: {
        display: 'flex',
        justifyContent: 'flex-left'
        //not working!!!!!
    },
    fav:{
        border: '0.5px'
    }
}
